window.bookSummaryJSON = "<p><b>My dream of becoming prima ballerina is dead. </b></p> <p>Dropped by the Royal Ballet, I return home to my empty house in Cornwall with nothing but ghosts, and memories of a past I am desperate to forget. </p> <p>It takes months of depression before I pull myself out of the bleakness and attempt to start living again. With a new job as an assistant to the wealthy but elusive Sachov family, I find myself caught up in a tangled web of desire, pain, and sexual awakening that will either destroy me entirely or bring me back to life. </p> <p>My name is Rose, and I am their muse. </p> <p><b><i>Contains mature themes.</i></b></p>"; 
